import React from 'react';
import ReactDOM from 'react-dom';
import Navbar from './Navbar'


const App = () => {
  return (
    <div>
      <img src="../src/logo.png"/>
      <Navbar/>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'));
